			shellScript = "#!/bin/bash\n\n# Determine the environment (flavor) from the Build Configuration\nenvironment=\"default\"\n\n# Extract the environment (flavor) from the CONFIGURATION variable\nif [[ $CONFIGURATION =~ -([^-]*)$ ]]; then\n    environment=${BASH_REMATCH[1]}\nfi\n\necho \"Environment: $environment\"\n\n# Paths for GoogleService-Info.plist and justpay.json\nGOOGLESERVICE_INFO_PLIST=\"GoogleService-Info.plist\"\nGOOGLESERVICE_INFO_FILE=\"${PROJECT_DIR}/config/${environment}/${GOOGLESERVICE_INFO_PLIST}\"\n\nJUSTPAY_JSON=\"justpay.json\"\nJUSTPAY_JSON_FILE=\"${PROJECT_DIR}/config/${environment}/${JUSTPAY_JSON}\"\n\n# Destination for GoogleService-Info.plist and justpay.json\nPLIST_DESTINATION=\"${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app\"\necho \"Destination: ${PLIST_DESTINATION}\"\n\n# Create the destination directory if it does not exist\nif [ ! -d \"$PLIST_DESTINATION\" ]; then\n    echo \"Creating destination directory: ${PLIST_DESTINATION}\"\n    mkdir -p \"$PLIST_DESTINATION\"\nfi\n\n# Check if GoogleService-Info.plist exists and copy it\necho \"Looking for ${GOOGLESERVICE_INFO_PLIST} in ${GOOGLESERVICE_INFO_FILE}\"\nif [ -f \"$GOOGLESERVICE_INFO_FILE\" ]; then\n    cp \"$GOOGLESERVICE_INFO_FILE\" \"$PLIST_DESTINATION\"\n    echo \"Copied ${GOOGLESERVICE_INFO_PLIST} to ${PLIST_DESTINATION}\"\nelse\n    echo \"No ${GOOGLESERVICE_INFO_PLIST} found. Please ensure it's in the proper directory.\"\n    exit 1\nfi\n\n# Check if justpay.json exists and copy it\necho \"Looking for ${JUSTPAY_JSON} in ${JUSTPAY_JSON_FILE}\"\nif [ -f \"$JUSTPAY_JSON_FILE\" ]; then\n    cp \"$JUSTPAY_JSON_FILE\" \"$PLIST_DESTINATION\"\n    echo \"Copied ${JUSTPAY_JSON} to ${PLIST_DESTINATION}\"\nelse\n    echo \"No ${JUSTPAY_JSON} found. Please ensure it's in the proper directory.\"\n    exit 1\nfi\n";
